import './App.css';
import AppHeader from '../App/AppHeader/header';
import MainPage from '../App/MainPage/MainPage';
import Content from '../App/ContentPage/Content';
import AboutUs from '../App/AboutUs/AboutUs';
import AboutUsExtra from '../App/AboutUsExtra/AboutUsExtra';
import Experts from '../App/Experts/Experts';
import Footer from '../App/AppFooter/Footer';
import { ThemeProvider } from '../App/ThemeSwitch/ThemeContext';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

const App = () => {
  return (
    <ThemeProvider>
      <Router>
        <AppHeader />
        <Switch>
          <Route exact path="/" component={MainPage} />
          <Route path="/about" component={AboutUs} />
          <Route path="/content" component={Content} />
          <Route path="/about-extra" component={AboutUsExtra} />
          <Route path="/experts" component={Experts} />
        </Switch>
        <Footer />
      </Router>
    </ThemeProvider>
  );
};

export default App;
